import React from 'react';
// import Error from './Error';
import { Route, Switch } from 'react-router-dom';
import Navbar from './Navbar';

const App = () => {
  return (
    <div>
      <Switch>
        <Navbar />
      </Switch>
    </div>
  );
};

export default App;
